commits.sourceNew:
@Override
public boolean equals(Object o) {
  if (this == o) return true;
  if (!(o instanceof Rectangle2D)) return false;
  Rectangle2D that = (Rectangle2D) o;
  return minX == that.minX &&
      maxX == that.maxX &&
      minY == that.minY &&
      maxY == that.maxY &&
      Arrays.equals(bbox, that.bbox) &&
      Arrays.equals(west, that.west);
}

